import React from 'react';
import ReactDOM from 'react-dom';
import {BrowserRouter as Router, Link, Switch, Route} from 'react-router-dom';
import './index.css'
import Pokedex from './components/PokeDex';


ReactDOM.render(
    <Router>
        <Switch>
            <Route path="/">
                <Pokedex name="Khanh's Pokedex"/>,
            </Route>
        </Switch>
    </Router>
);
